import { Route, Router, Routes } from "react-router-dom";
import "./App.css";
import Login from "./Login/Login";
import Navbar from "./Navbar/Navbar";

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/Login" element={<Login />} />
      </Routes>
    </Router>
  );
}

export default App;
